import React from 'react';
//import logo from '../../img/logo-187x66.png';
import classes from './About.module.css'
import BlockHead from "../BlockHead/BlockHead";
import BannerHead from "../../img/slider_image.png";


let arrHead = " is an IT company in India, offering quality software related solutions including <strong>Mobile Application Development</strong>,  We believe in <strong>“Complete Customer Satisfaction”</strong>  as our definition of quality.";




const  About = () =>{
    return (
        <div className={classes.block}>
            <BlockHead  text={arrHead} img={BannerHead}/>
        </div>
    );
};


export default About;
